class Solution(object):
    def increasingTriplet(self, nums):
        """
        :type nums: List[int]
        :rtype: bool
        """
        if not nums:
            return False

        maximun = float('inf')
        minimun = nums[0]
        length = len(nums)

        for i in range(0, length - 1):
            if nums[i] < nums[i + 1]:
                if nums[i] > minimun or nums[i + 1] > maximun:
                    return True
                maximun = min(maximun, nums[i + 1])

            minimun = min(minimun, nums[i])

        return False

test = Solution()
print(test.increasingTriplet([1, 2, 1, 2, 1, 2]))
